class Solution(object):
    def isAnagram(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        s_freq={}
        t_freq={}
        if len(s)==len(t):
            for i in range(len(s)):
                s_freq[s[i]]=s_freq.setdefault(s[i],0)+1
                t_freq[t[i]]=t_freq.setdefault(t[i],0)+1
            if s_freq==t_freq:
                return True
            else:
                return False
        else:
            return False
if __name__=="__main__":
    obj=Solution()
    s=""
    t=""
    s1="aacc"
    t1="ccac"
    print(obj.isAnagram(s1,t1))